import React, {createContext, useState} from "react";

export const HightContext = createContext();

const HightContextProvider = ({children}) => {
    
    const [hight, setHight] = useState(10);

    return (
        <HightContext.Provider value={[hight, setHight]}>
            {children}
        </HightContext.Provider>
    );
};
export default HightContextProvider;
